ALTER TABLE Teams
	ALTER COLUMN Email TYPE VARCHAR (100);

CREATE OR REPLACE FUNCTION SetValidAwayTeam()
	RETURNS TRIGGER
AS
$$
	BEGIN
	WHILE NEW.HomeTeamId = NEW.AwayTeamId LOOP 
		NEW.AwayTeamId := floor(random()*1000)+1;
	END LOOP;
	RETURN NEW;
	END;
$$
language plpgsql;

CREATE TRIGGER CheckTeamsInMatch
	BEFORE INSERT OR UPDATE ON Matches
	FOR EACH ROW
	EXECUTE FUNCTION SetValidAwayTeam();









